import React, { useContext } from 'react'
import {userContext} from './../../context/context'
import Axios from 'axios'
import { Link } from 'react-router-dom';
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import { Button } from '@material-ui/core';
import { toast, ToastContainer } from 'react-toastify';
export default function AdminNav() {
    let context = useContext(userContext);
    const handleLogoutOperation = async () => {
        try {
            let res = await Axios(
                {
                    method:"DELETE",
                    url:"http://localhost:5000/api/Auth",
                    headers:{
                        auth: context.token
                    }
                }
            );
            if(res.status===200){

                localStorage.removeItem('token');
                context.setToken('');
            }
        } catch (error) {
           toast('Somthing Went Wrong try Again',{type:"error"});
        }
    }
    return (
    <nav className=" shadow navbar navbar-expand-lg navbar-light bg-light sticky-top">
        <ToastContainer />
        <div className="container-fluid">
            <Link className="navbar-brand" to="#">Admin</Link>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                    <li className="nav-item">
                    <Link className="nav-link active" aria-current="page" to="#">Home</Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link active" to="/admin/edit-profile">Profile Management</Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link active" to="/admin/edit-profile">Blog Management</Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link active" to="/admin/edit-profile">Project Hosting</Link>
                    </li>
                </ul>
            </div>
            <div className="d-flex justify-content-end">
                <div className="d-flex mr-4">
                    <img className="mr-2" src="data:image/jpeg;base64," height="30" width="30" alt="" />
                    <h5>
                        <strong>
                            <b>
                                blackcoder56
                            </b>
                        </strong>
                    </h5>
                </div>
                <Button onClick={handleLogoutOperation}>
                    <ExitToAppIcon />
                </Button>

            </div>
        </div>
    </nav>
    )
}
